import "./App.css";
import InputSample from "./InputSample";
import UserList from "./UserList";

function App() {
  const users = [
    {
      id: 1,
      name: "sookmyung",
      email: "sookmyung@example.com",
    },
    {
      id: 2,
      name: "mutsa",
      email: "likelionsmwu@example.com",
    },
    {
      id: 1,
      name: "youbin",
      email: "youb@example.com",
    },
  ];

  return (
    <>
      <InputSample />
      <br />
      <hr />
      <UserList users={users} />
    </>
  );
}

export default App;
